【商品説明】<BR>虫と紫外線をＷブロックする衣類用スプレー。虫よけ効果は24時間長持ち、紫外線を90％以上カット。<BR>ノンパウダータイプなので衣類が白くなりません。<BR><BR>商品サイズ：53×174×53<BR><BR>効能・効果：ユスリカ、アリ、チョウバエ、イガ、コイガ、ヨコバイ<BR><BR>成分：【有効成分】ディート、【その他の成分】メトキシケイヒ酸エチルヘキシル、ＢＧ、無水エタノール、ＬＰＧ、<BR><BR>ご使用上の注意等：●使用前に必ず製品表示を読み、十分理解した上で使用してください。<BR>●人体に使用しないでください。<BR>●目的とする効能、効果にそって定められた使用方法を厳守して使用してください。<BR>●噴射直後は火気を近づけないこと。<BR>●1分以上連続噴射しないこと。<BR>●換気すること。<BR>●アレルギー症状やかぶれを起こしやすい人、喘息の症状がある人、病人、妊婦、乳幼児がいる場所では使用しないでください。 <BR>●環境を汚染しないために乱用は避けてください。 <BR>●目に入ったり、飲んだり、なめたり、吸い込んだりすることがないようにしてください。万一目に入った場合には、すぐに大量の水又はぬるま湯でよく洗い流してください。また、具合が悪くなる等の症状が現れた場合には、直ちに本品にエタノールとディートが含まれていることを医師に告げて診療を受けてください。 <BR>●使用中は喫煙、飲食等はしないでください。<BR><BR>●直射日光や火気を避け、子供の手の届かない涼しいところに保管してください。、●暖房器具（ファンヒーター等）の周囲は、温度が上がり破裂する危険があるので置かないでください。、●缶のさびを防ぐため、水周りや湿気の多い場所に置かないでください。<BR><BR>原産国：日本<BR><BR>問い合わせ先：アース製薬株式会社 〒101-0048 東京都千代田区神田司町2-12-1 （お客様窓口)TEL0120-81-6456<BR>商品区分：虫除け<BR>JANコード：4901080190116<br><br>【デング熱対策】<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
